//SPDX-License-Identifier: MIT
pragma solidity 0.8.17;

library IterableMapping {
    // Struct to hold registration details
    struct RegistrationDetails {
        string name;
        string dob;
        string place;
        string sex;
        uint256 aadhaarNumber;
    }

    // Iterable mapping from address to RegistrationDetails
    struct Map {
        address[] keys;
        mapping(address => RegistrationDetails) values;
        mapping(address => uint256) indexOf;
        mapping(address => bool) inserted;
    }

    function get(Map storage map, address key) public view returns (RegistrationDetails storage) {
        return map.values[key];
    }

    function getKeyAtIndex(Map storage map, uint256 index) public view returns (address) {
        return map.keys[index];
    }

    function size(Map storage map) public view returns (uint256) {
        return map.keys.length;
    }

    function set(Map storage map, address key, RegistrationDetails memory val) public {
        if (map.inserted[key]) {
            map.values[key] = val;
        } else {
            map.inserted[key] = true;
            map.values[key] = val;
            map.indexOf[key] = map.keys.length;
            map.keys.push(key);
        }
    }

    function remove(Map storage map, address key) public {
        if (!map.inserted[key]) {
            return;
        }

        delete map.inserted[key];
        delete map.values[key];

        uint256 index = map.indexOf[key];
        address lastKey = map.keys[map.keys.length - 1];
        map.indexOf[lastKey] = index;
        delete map.indexOf[key];
        map.keys[index] = lastKey;
        map.keys.pop();
    }
}

contract Registration {
    using IterableMapping for IterableMapping.Map;

    // Iterable mappings for different registration statuses
    IterableMapping.Map private unverifiedRegistrations;
    IterableMapping.Map private verifiedRegistrations;
    IterableMapping.Map private rejectedRegistrations;

    // Event to log registration status changes
    event RegistrationStatusChanged(address indexed user, string newStatus);

    // Function to register a new user
    function register(
        string memory _name,
        string memory _dob,
        string memory _place,
        string memory _sex,
        uint256 _aadhaarNumber
    ) public {
        // Check if registration already exists
        require(
            bytes(unverifiedRegistrations.get(msg.sender).name).length == 0 &&
                bytes(verifiedRegistrations.get(msg.sender).name).length == 0 &&
                bytes(rejectedRegistrations.get(msg.sender).name).length == 0,
            "Registration already exists"
        );

        // Add registration details to unverified registrations
        unverifiedRegistrations.set(
            msg.sender,
            IterableMapping.RegistrationDetails(_name, _dob, _place, _sex, _aadhaarNumber)
        );
    }

    // Function to get addresses of unverified registrations
    function getUnverifiedAddresses() public view returns (address[] memory) {
        address[] memory unverifiedAddresses = new address[](unverifiedRegistrations.size());
        uint256 count = 0;
        for (uint256 i = 0; i < unverifiedRegistrations.size(); i++) {
            address user = unverifiedRegistrations.getKeyAtIndex(i);
            if (bytes(unverifiedRegistrations.get(user).name).length > 0) {
                unverifiedAddresses[count] = user;
                count++;
            }
        }
        return unverifiedAddresses;
    }

    // Function to verify registration using address
    function verifyRegistration(address _user) public {
        // Check if registration exists in unverified registrations
        require(
            bytes(unverifiedRegistrations.get(_user).name).length > 0,
            "Registration does not exist or already verified/rejected"
        );

        // Move registration from unverified to verified
        verifiedRegistrations.set(_user, unverifiedRegistrations.get(_user));
        unverifiedRegistrations.remove(_user);
        emit RegistrationStatusChanged(_user, "verified");
    }

    // Function to reject registration using address
    function rejectRegistration(address _user) public {
        // Check if registration exists in unverified registrations
        require(
            bytes(unverifiedRegistrations.get(_user).name).length > 0,
            "Registration does not exist or already verified/rejected"
        );

        // Move registration from unverified to rejected
        rejectedRegistrations.set(_user, unverifiedRegistrations.get(_user));
        unverifiedRegistrations.remove(_user);
        emit RegistrationStatusChanged(_user, "rejected");
    }
}
